configure:
  commands:
    end:
      new_state: execute
    hw-module slot 5 breakout 5: "hw-module slot 5 breakout 5\r\nBreakout: Enabling\
      \ breakout ports on Hu5/0/5 successful.\r\nSubports Created: Hu5/0/5/1 to Hu5/0/5/4\r\
      \n\r\nTF-C9600-StackWiseVi(config)#"
    line console 0:
      new_state: configure_line
    no logging console: ''
  prompt: TF-C9600-StackWiseVirtual(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: TF-C9600-StackWiseVirtual(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    show version | include operating mode: '' 
    term length 0: ''
    term width 0: ''
  prompt: TF-C9600-StackWiseVirtual#
